const ExperienceLoader = (props) => {
  const { title, level } = props;

  return (
    <div>
      <div className="flex justify-between">
        <p className="text-sm font-medium tracking-wide text-gray-700">
          {title}
        </p>
        <p className="text-sm font-medium tracking-wide text-gray-700">
          {level}%
